import styled from "styled-components";

export const SongsMainWrapper = styled.div`
  .songs-list {
    display: flex;
    /* flex 元素实现多行排列 */
    flex-wrap: wrap;
    justify-content: space-between;
    margin-right: -30px;
  }
`;
